style.css:
@-moz-document url("http://10.0.0.75/?&mod=server_status") {
body {
	padding-top: 40px;
    padding-left: 90px;
    padding-right: 10px;
    -webkit-text-size-adjust: none;
	-webkit-touch-callout: none;
	-webkit-user-select: none;
	-khtml-user-select: none;
	-moz-user-select: moz-none;
	-ms-user-select: none;
	user-select: none;
}

body.black_background {
	background: black;
}

body.black_background .page-header {
	border-bottom: 0;
}

body.black_background .page-header  h1 {
	color: #888;
}

.navbar-fixed-top {
	position: fixed;
	margin: 0;
}
.navbar-fixed-top .navbar-inner {
	padding-left: 85px;
	padding-right: 0;
}
.sidebar-nav .btn {
	margin: 5px 0;
	min-width: 100px;
}
.navbar .nav .divider {
	height: 1px;
	overflow: hidden;
	background-color: #444;
}

#main-container {
	padding-left: 20px;
	padding-right: 15px;
}

#main-content {
	display: table;
	width: 100%;
}

#sidebar-container {
	display: table-cell;
	vertical-align: top;
	width: 1px;
	white-space: nowrap;
}

#page-container {
	display: table-cell;
	vertical-align: top;
}

.powered {
	display: inline-block;
	white-space: nowrap;
}

.page-header {
	display: table;
	width: 100%;
}
.header-label {
	display: table-cell;
}
.header-accessories {
	display: table-cell;
	white-space: nowrap;
	text-align: right;
}
.header-accessories .btn-group {
	display: inline-block;
	vertical-align: bottom;
}

table {
  background-color: white;
}
.tab-content {
	display: block;
	width: auto;
	padding-top: 0;
	padding-bottom: 0;
}
.tab-content.well {
	padding-top: 19px;
}
.nav-tabs {
	position: relative;
	top: 1px;
	margin-left: 10px;
	margin-bottom: 0;
	border: 0;
}
.nav-tabs > .active > a, .nav-tabs > .active > a:hover {
	background-color: #f5f5f5;
	-webkit-box-shadow: inset 0 1px 1px rgba(0, 0, 0, 0.05);
	-moz-box-shadow: inset 0 1px 1px rgba(0, 0, 0, 0.05);
	box-shadow: inset 0 1px 1px rgba(0, 0, 0, 0.05);
}
.nav-tabs > li > a, .nav-tabs > li > a:hover {
	padding: 8px 8px;
}

/** Rtl language Style */
.rtl{
	direction:rtl;
}
.rtl body,.rtl p,.rtl input,.rtl button,.rtl select,.rtl textarea,.rtl .jqplot-target{
	font-family:sans-serif;
}
.rtl .navbar .brand{
	float:right;
}
.rtl .navbar .nav{
	float:right;
}
.rtl .navbar .nav.pull-right{
	float:left;
}
.rtl .pull-right{
	float:left;
}
.rtl .pull-left{
	float:right;
}
.rtl .navbar .nav>li{
	float:right;
}
.rtl .header-accessories{
	text-align:left;
}
.rtl .form-horizontal .control-label{
	float:right;
}
.rtl .btn-group .btn{
	float:right;
}
.rtl .nav-tabs>li,.rtl .nav-pills>li{
	float:right;
}
.rtl .form-horizontal .controls{
	margin-right:190px;
}
.rtl .radio input[type="radio"],
.rtl .checkbox input[type="checkbox"]{
	float:right;
	margin-right:-18px;
}
.rtl .radio,
.rtl .checkbox{
	padding-right:18px;
}
.rtl .entity{
	text-align: right;
	margin-left:20px;
	margin-right:0;
}
.rtl .btn-group .btn:last-child{
	margin-left:0;
	-webkit-border-top-left-radius:4px;
	-moz-border-radius-topleft:4px;
	border-top-left-radius:4px;
	-webkit-border-bottom-left-radius:4px;
	-moz-border-radius-bottomleft:4px;
	border-bottom-left-radius:4px;
	-webkit-border-top-right-radius:0;
	-moz-border-radius-topright:0;
	border-top-right-radius:0;
	-webkit-border-bottom-right-radius:0;
	-moz-border-radius-bottomright:0;
	border-bottom-right-radius:0;
}
.rtl .btn-group .btn:first-child{
	-webkit-border-top-right-radius:4px;
	-moz-border-radius-topright:4px;
	border-top-right-radius:4px;
	-webkit-border-bottom-right-radius:4px;
	-moz-border-radius-bottomright:4px;
	border-bottom-right-radius:4px;
	-webkit-border-top-left-radius:0;
	-moz-border-radius-topleft:0;
	border-top-left-radius:0;
	-webkit-border-bottom-left-radius:0;
	-moz-border-radius-bottomleft:0;
	border-bottom-left-radius:0;
}
.rtl .table th, .rtl .table td {
	text-align:right;
}
.rtl .dropdown-menu{
	right:0;
	left:inherit;
}

/* Tables */
.align-middle {
	vertical-align: middle;
}
.tight {
	width: 10px;
	white-space: nowrap;
}
.nowrap {
	white-space: nowrap;
}

.table-body {
	display: table;
	width: 100%;
}
.table-row {
	display: table-row
}
.table-cell {
	display: table-cell;
	vertical-align: top;
}
.table-cell-title {
	display: table-cell;
	vertical-align: middle;
	height: 32px;
}
.table-cell-title .label {
	position: relative;
	top: -2px;
}

.table-separator {
	margin: 4px 0;
	border-top: 1px solid #EEE;
	border-bottom: 1px solid #FFF;
}

td.cell-center {
	text-align: center;
}

@media (max-width: 767px) {
	.table-cell .title, .table-cell-title .title {
		font-size: 1.1em;
		font-weight: bold;
	}
}
.table-cell-details {
	display: table-cell;
	font-size: 11px;
	font-style: italic;
	line-height: 13px;
}

/* Form */
legend {
	margin-top: 0px;
	margin-bottom: 0px;
}
.form-horizontal .control-label {
	width: 180px;
}
.form-horizontal .controls {
	margin-left: 190px;
}
.form-horizontal .form-actions {
	padding-left: 190px;
	margin-bottom: 0;
}
.form-horizontal label {
	font-weight: bold;
}
.help-block {
	font-style: italic;
	color: #666;
}

/* Status page */

h2 {
	font-size: 16px;
	line-height: 12px;
}

h2 small {
	font-size: 18px;
}


.offline, .online {
	display: inline-block;
	width: 100%;
	max-width: 320px;
}
.entity {
	text-align: left;
	padding: 10px;
	box-shadow: 0px 0px 5px #666;
	border-radius: 3px;
	margin-right: 20px;
	margin-bottom: 20px;
	cursor: pointer;
}
.entity h2 {
	margin-bottom: 10px;
}
.entity p {
	margin: 0;
	padding: 0;
}
.offline .entity {
	background: #a00000;
	color: #f7cece;
	border: 2px solid #f7cece;
}
.offline .entity.warning {
	background: #FAA732;
	color: #F3F3B1;
	border: 2px solid #F3F3B1;
}
.online .entity {
	background: #53a000;
	color: #d8f7ce;
	border: 2px solid #d8f7ce;
}
.entity-container table td {
	padding: 6px 8px;
	vertical-align: middle;
}
.row-offline, .row-online {
	cursor: pointer;
}
.row-offline td, .row-offline tr:hover td {
	background: #a00000 !important;
	color: #f7cece;
}
.row-offline td.warning, .row-offline tr:hover tr.warning {
	background: #FAA732 !important;
	color: #F3F3B1;
}
.row-online td, .row-online tr:hover td {
	background: #53a000 !important;
	color: #d8f7ce;
}
.entity-container .server-name {
	display: inline-block;
	font-size: 1.15em;
	line-height: 18px;
	font-weight: bold;
	white-space: nowrap;
}

.visible-small {
	display: none;
}

td.visible-desktop, th.visible-desktop,
td.hidden-phone, th.hidden-phone,
td.hidden-tablet, th.hidden-tablet {
	display: table-cell;
}

span.visible-desktop, span.visible-desktop,
span.hidden-phone, span.hidden-phone,
span.hidden-tablet, span.hidden-tablet {
	display: inline-block;
}

span.visible-phone, span.visible-phone,
span.visible-tablet, span.visible-tablet,
span.hidden-desktop, span.hidden-desktop {
	display: none;
}

@media (min-width: 980px) {
	.hidden-desktop {
		display: none !important;
	}
}
@media (max-width: 979px) {
	#sidebar-container {
		display: table-row;
	}
	#page-container {
		display: table-row;
	}
	.sidebar-nav .nav-list {
		padding: 0;
	}
	.sidebar-nav li.nav-header {
		display: none;
	}
	.sidebar-nav li {
		float: left;
		margin-right: 15px;
	}
	.navbar .brand {
		margin-left: -10px;
	}
	.visible-desktop {
		display: none !important;
	}
	.tab-content.well {
		padding-left: 10px;
		padding-right: 10px;
	}
}
@media (max-width: 767px) {
	td.visible-phone, th.visible-phone,
	td.hidden-desktop, th.hidden-desktop {
		display: table-cell;
	}
	span.visible-phone, span.visible-phone,
	span.hidden-desktop, span.hidden-desktop {
		display: inline-block;
	}
	td.hidden-phone, th.hidden-phone,
	td.visible-desktop, th.visible-desktop {
		display: none;
	}
	span.hidden-phone, span.hidden-phone,
	span.visible-desktop, span.visible-desktop {
		display: none;
	}
}
@media (min-width: 768px) and (max-width: 979px) {
	td.visible-tablet, th.visible-tablet,
	td.hidden-desktop, th.hidden-desktop {
		display: table-cell;
	}
	span.visible-tablet, span.visible-tablet,
	span.hidden-desktop, span.hidden-desktop {
		display: inline-block;
	}
	td.hidden-tablet, th.hidden-tablet,
	td.visible-desktop, th.visible-desktop {
		display: none;
	}
	span.hidden-tablet, span.hidden-tablet,
	span.visible-desktop, span.visible-desktop {
		display: none;
	}
}
@media (max-width: 479px) {
	#main-container, .container-fluid {
		padding-left: 10px;
		padding-right: 10px;
	}
	.form-horizontal .controls {
		margin-left: 0px;
	}
	.form-horizontal .form-actions {
		padding-left: 10px;
		text-align: center;
	}

	.entity-container {
		text-align: center;
	}
	.entity {
		margin: 0 10px 20px 10px;
	}
	.hidden-small {
		display: none !important;
	}
	.action-small {
		text-align: center !important;
		background-color: white;
	}
	.visible-small {
		display: block;
	}
	td.visible-small {
		display: table-cell;
	}
}

body.install{
    padding-top:20px;
}
.install_header h2 {
	line-height: 100px;
}
.install_header img {
	height: 100px;
}

.label-status-on, .label-status-off, .label-status-warning {
	vertical-align: baseline;
}
